import Square from "./Square"

export default function Board() {
    return (
        <div class="board">
            <h1 class="title">Count:</h1>
            <Square name="one" class="one"/>
            <Square name="two" class="two"/>
            <Square name="three" class="three"/>
            <Square name="four" class="four"/>
        </div>
    )
}
